// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.7.0;

import "../utlis/Helper.sol";
import "../authority/Member.sol";

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

/**
 * @title Fighter Z Token - ERC721
 *
 * It's mainly used for pledge to get M3T Token
 * QUANTITIES: 2 MILLION | DECIMALS: 18
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-3-28 | VERSION: v1.0.2
 */

contract Fighter is Member, ERC721 {
    using SafeMath for uint256;

    uint64[] public _special;
    uint256 public _total_powers;
    uint256 public _total_reward;

    mapping (address => uint256) public _powers;
    mapping (address => uint256) public _periods;

    uint256 constant public SPECIAL_PERIOD = 7 days;

    event Claim(address account, uint256 reward);

    constructor(address auth_) Member(auth_)
        ERC721("Fighter Z", "DBNFT") {

        _total_reward = 1e25;
    }

    function _getSecondReward() private view
        returns (uint256 sr) {

        sr = _total_reward.div(365);
        sr = sr.div(24).div(60).div(60);
    }

    function doMint(address to_, uint64 tokenId_)
        external CheckPermit("CARDSHOP") {

        (uint8 q, ,) = Helper.analysis(tokenId_);
        if (q == 0) { _special.push(tokenId_); }

        _safeMint(to_, tokenId_);

        _powers[to_] = _powers[to_].add(q);
        _total_powers = _total_powers.add(q);

        if (_periods[to_] <= 0) {
            _periods[to_] = block.timestamp;
        }

        for (uint i = 0; i < _special.length; i++) {
            uint64 item = _special[i];
            uint256 timestamp = uint32(item >> 12);
            uint256 period = timestamp + SPECIAL_PERIOD;

            if (period >= block.timestamp) {
                _burn(item);
            }
        }
    }

    function doBurn(uint256 tokenId_) external
        CheckPermit("EXCHANGE") {

        address sender = ownerOf(tokenId_);
        (uint8 q, ,) = Helper.analysis(uint64(tokenId_));

        _burn(tokenId_);

        _powers[sender] = _powers[sender].sub(q);
        _total_powers = _total_powers.sub(q);
    }

    function getReward(address account_) public view
        returns (uint256 reward) {

        uint256 second_reward = _getSecondReward();
        uint256 power_rate = _powers[account_].mul(1e8);
        power_rate = power_rate.div(_total_powers).div(1e8);

        uint256 period = _periods[account_] - block.timestamp;
        reward = second_reward.mul(period).mul(power_rate).div(100);
    }

    function claim() public {
        uint256 reward = getReward(msg.sender);
        require(reward > 0, "FIGHTER: The reward is zero.");

        _periods[msg.sender] = block.timestamp;
        IERC20(authority.members("TOKEN")).transferFrom(
            authority.members("REWARD"), msg.sender, reward
        );

        emit Claim(msg.sender, reward);
    }
}

